import React from 'react';
import {Card, Popover} from 'antd';
import {RetweetOulined, HeartOutlined, MessageOutlined, EllipsisOutlined} from '@ant-design/icons';

const PostCard = ({post}) =>{
    return (
        <div>
            <Card cover={post.Images[0] && <PostImages images={post.Images}/>}
                actions={[
                    <RetweetOulined/>,
                    <HeartOutlined/>,
                    <MessageOutlined/>,
                    <Popover>
                        <EllipsisOutlined/>
                    </Popover>
                ]}
            >
                <Image />
                <Content />
                <Buttons></Buttons>
            </Card>
            <CommentForm />
            <Comments/>
        </div>
    );
};

export default PostCard;
